import React from 'react';
import banner from './img/banner.jpg';

const Content = () => {
    return (
        <div>
            <div className='banner relative mt-10 '>
                <div className="w-full h-full rounded-lg relative">
                    <div class="overlay absolute inset-0 ">  </div>
                    <img src={banner}
                        alt=""
                        className=" w-full h-full object-cover rounded-lg"
                    />
                    <div className="absolute left-5 bottom-5 text-white mb-10 w-[350px]">
                        <h3 className='text-2xl font-medium mb-6'>Sweat-Wicking Performance</h3>
                        <span className='font-extralight text-xl'>With a cropped silhouette for modern comfort that's made to move.</span>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default Content;
